INSERT INTO `test_data_results` VALUES (1,'OK','মিটারটি ভলো আছে।','ব্যবহার উপযোগী।',1,0),(2,'IMD','আভ্যন্তরীণ কারণে মিটারটির যন্ত্রাংশ নষ্ট।','ব্যবহার অনুপযোগী।',1,3),(3,'3ϕ OK','বাহ্যিক দৃষ্টিতে ত্রুটি পরিলক্ষিত হয়নি।','পরীক্ষার জন্য বিআরইবিতে প্রেরণ প্রক্রিয়াধীন।',1,10),(4,'3ϕ Burn','মিটারটি পুড়া।','পরীক্ষার জন্য বিআরইবিতে প্রেরণ প্রক্রিয়াধীন।',1,11),(5,'ICD','আভ্যন্তরীণ কারণে মিটারটির সার্কিট নষ্ট।','ব্যবহার অনুপযোগী।',1,4),(6,'Rust','দীর্ঘদিন ব্যবহার ও মরিচা জনিত কারণে যন্ত্রাংশ নষ্ট।','ব্যবহার অনুপযোগী।',1,1),(7,'IBD','আভ্যন্তরীণ কারণে ব্যাটারী ও যন্ত্রাংশ নষ্ট।','ব্যবহার অনুপযোগী।',1,5),(8,'LCD','আভ্যন্তরীণ কারণে মিটারটির LCD মনিটর নষ্ট।','ব্যবহার অনুপযোগী।',1,9),(9,'WSP','মিটারটির কাঠ স্ক্রু পয়েন্ট ভাঙ্গা ।','ব্যবহার অনুপযোগী।',1,24),(10,'Broken','মিটারটি ভাঙ্গা।','ব্যবহার অনুপযোগী।',1,15),(11,'Burn','মিটারটি পুড়া।','ব্যবহার অনুপযোগী।',1,8),(12,'Burn base','মিটারটির বেস পুড়া।','ব্যবহার অনুপযোগী।',1,16),(13,'NGD','প্রাকৃতিক কারণে গ্লাস কভার লাল ও যন্ত্রাংশ নষ্ট।','ব্যবহার অনুপযোগী।',1,18),(14,'ICB','আভ্যন্তরীণ কারণে সার্কিট পোড়া।','ব্যবহার অনুপযোগী।',1,6),(15,'LB','মিটারটির লোড সাইড পোড়া।','ব্যবহার অনুপযোগী।',1,19),(16,'SB','মিটারটির সোর্স সাইড পোড়া।','ব্যবহার অনুপযোগী।',1,21),(17,'Red','আভ্যন্তরিন কারণে মিটারটির গ্লাস কভার  লাল ও যন্ত্রাংশ নষ্ট।','ব্যবহার অনুপযোগী।',1,20),(18,'Down','যান্ত্রিক কারণে মিটারটির সার্কিট ও ব্যাটারী নষ্ট হওয়ায় রিডিং অস্বাভাবিক।','ব্যবহার অনুপযোগী।',1,17),(19,'Auto_imp','যান্ত্রিক কারণে সার্কিট ও ব্যাটারী নষ্ট হওয়ায় বিনা লোডে রিডিং পরিবর্তন হয়।','ব্যবহার অনুপযোগী।',1,7),(20,'Blink','আভ্যন্তরীণ কারণে মিটারটির রিডিং অস্থির বা এলোমেলো দেখায়।','ব্যবহার অনুপযোগী।',1,13),(21,'Water','মিটারের ভিতরে পানি প্রবেশ করায় যন্ত্রাংশ নষ্ট।','ব্যবহার অনুপযোগী।',1,22),(22,'Base Burn','মিটারটির টার্মিনাল/বেস পুড়া।','পরীক্ষার জন্য বিআরইবিতে প্রেরণ প্রক্রিয়াধীন।',1,12),(23,'White Display','ডিসপ্লেতে রিডিং দেখা যায় না।','পরীক্ষার জন্য বিআরইবিতে প্রেরণ প্রক্রিয়াধীন।',1,23),(24,'Broken','মিটারটি ভাঙ্গা।','পরীক্ষার জন্য বিআরইবিতে প্রেরণ প্রক্রিয়াধীন।',1,14),(25,'Rust Burn','দীর্ঘদিন ব্যবহার ও মরিচা জনিত কারণে যন্ত্রাংশ নষ্ট, পুড়া।।','ব্যবহার অনুপযোগী।',1,2);
